import PortfolioListNew from "../elements/portfolio/PortfolioListNew";
import { Parallax } from "react-parallax";

const image1 = '/assets/images/bg/riverTube2.0.png';

const portfolioItems = [
    {
        image: 'image-1',
        category: 'Development',
